import React from 'react'
import Cardlist from './Cardlist'
import {robots} from './robots'

const Card = ({name, email, id}) => {
    return (
        <div className="br2"> 
            <img alt="cool" src={`https://robohash.org/${id}ds?200x200`}/>
            <h1>{name}</h1>
            <p>{email}</p>
        </div>
    )
}

export default Card
